import React, { useState } from 'react';
import './PropertyFormdetails.css'

function PropertyFormdetails() {
  const [fullName, setFullName] = useState('');
  const [dateOfBirth, setDateOfBirth] = useState('');
  const [policyType, setPolicyType] = useState('life'); // Default value for policy type
  const [coverageAmount, setCoverageAmount] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Perform form submission logic here
    console.log('Form submitted with:', { fullName, dateOfBirth, policyType, coverageAmount });
  };

  return (
    <div>
      <h2>Insurance Policy Information</h2>
      <form onSubmit={handleSubmit}>
        <label htmlFor="fullName">Full Name:</label>
        <input
          type="text"
          id="fullName"
          value={fullName}
          onChange={(e) => setFullName(e.target.value)}
          placeholder="Enter your full name"
          required
        />

        <label htmlFor="dateOfBirth">Date of Birth:</label>
        <input
          type="date"
          id="dateOfBirth"
          value={dateOfBirth}
          onChange={(e) => setDateOfBirth(e.target.value)}
          required
        />

        <label htmlFor="policyType">Policy Type:</label>
        <select
          id="policyType"
          value={policyType}
          onChange={(e) => setPolicyType(e.target.value)}
        >
          <option value="life">Life Insurance</option>
          <option value="auto">Auto Insurance</option>
          <option value="health">Health Insurance</option>
          {/* Add more options as needed */}
        </select>

        <label htmlFor="coverageAmount">Coverage Amount:</label>
        <input
          type="number"
          id="coverageAmount"
          value={coverageAmount}
          onChange={(e) => setCoverageAmount(e.target.value)}
          placeholder="Enter coverage amount"
          required
        />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default PropertyFormdetails;
